    public class Html2PdfBenchmarks
    {
        private readonly HttpClient _httpClient = new HttpClient();

        [Benchmark]
        public async Task Convert12SmallConcurrent()
        {
            var tasks = Enumerable
                .Range(1, 12)
                .Select(i => RequestResponse(SmallHtml));

            await Task.WhenAll(tasks);
        }

        [Benchmark]
        public async Task ConvertSmallSingle()
        {
            await RequestResponse(SmallHtml);
        }

        [Benchmark]
        public async Task ConvertLargeSingle()
        {
            await RequestResponse(LargeHtml);
        }

        [Benchmark]
        public async Task Convert12LargeConcurrent()
        {
            var tasks = Enumerable
                .Range(1, 12)
                .Select(i => RequestResponse(LargeHtml));

            await Task.WhenAll(tasks);
        }

        private async Task RequestResponse(string html)
        {
            using var request = new HttpRequestMessage()
            {
                RequestUri = new Uri("https://localhost:5001/Html2Pdf"),
                Method = HttpMethod.Post,
                Content = new StringContent("{\"html\":\"" + html + "\"}", Encoding.UTF8, "application/json")
            };

            using HttpResponseMessage response = await _httpClient.SendAsync(request).ConfigureAwait(false);

            response.EnsureSuccessStatusCode();
        }

